import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Start from '../components/Start';

import Home from '../pages/Home';


function Routes() {
    return (
        <Switch>

            <Route path="/" exact component={Start} />

        </Switch>
    );
}

export default Routes;
